import React from 'react';
import {Nav, Link} from 'react-bootstrap';

function Header(){
  return (
    <Nav>
      <Nav.Item>
        <Link to="/">
          <img src={"logo.png"} alt="Mohi.vn" title="Mohi.vn"/>
        </Link>
      </Nav.Item>
      <Nav.Item></Nav.Item>
    </Nav>
  )
}

export default Header;
